This is what I have for trade:

No longer available 1. One Remington/UMC 380 auto mega-pack = 250 rounds (95 grain MC); I would consider trading for 22LR of similar value (i.e. 3 to 4 bricks, depending on the brand / quality) or 300 rounds of 9mm ammo (i.e. 6 boxes of 50 or 3 boxes of 100...);

No longer available 2. Two boxes of Winchester 40 S&W, 165 grain FMJ (100 rounds each) = 200 total rounds; I would consider trading for 22LR of similar value (i.e. 3 bricks, I consider adding some cash, depending on the brand / quality of your 22LR) or 250 rounds of 9mm ammo (i.e. 5 boxes of 50...);

3. On box of 50 rounds, Remington/UMC 357 Magnum, 125 grain JSP (soft point); I would consider trading for 22LR of similar value (i.e. 1+ bricks of 22, depending on the brand / quality) or 100 rounds of 9mm ammo (i.e. 2 boxes of 50 / 1 x 100...);

No longer available 4. 3 boxes (20 rounds each) of TulAmmo .223 Rem, 55 grain FMJ, steel case / non-corrosive / boxer primed = total of 60 rounds; I would consider trading for 22LR or 9mm of similar value.

We will meet face-to-face, in a convenient location (close to W. Bloomfield and/or Dearborn area) - I will not drive out of the way to do the trade, unless there's an exceptional deal.
